import React from 'react';
import PropTypes from 'prop-types';

const NavBar = ({ title, icon }) => {
  return <div></div>;
};

NavBar.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
};

export default NavBar;
